            __html: '<h2 id="你好世界">你好，世界！<a class="anchor" href="Getting-Started/Hello-World.html#你好世界">§</a></h2>\n<p>让我们编写第一个Rocket应用程序！首先创建一个新的基于二进制的Cargo项目，然后切换到新目录：</p>\n<pre class="language-shell"><code class="language-shell">cargo new hello-rocket --bin\n<span class="token builtin class-name">cd</span> hello-rocket\n</code></pre>\n<p>现在，将Rocket添加为依赖项<code>Cargo.toml</code>：</p>\n<pre class="language-shell"><code class="language-shell"><span class="token punctuation">[</span>dependencies<span class="token punctuation">]</span>\nrocket <span class="token operator">=</span> <span class="token string">"0.4.2"</span>\n</code></pre>\n<p>进行修改<code>src/main.rs</code>，使其包含Rocket <code>Hello, world!</code>程序的代码，如下所示：</p>\n<pre class="language-rust"><code class="language-rust"><span class="token attribute attr-name">#![feature(proc_macro_hygiene, decl_macro)]</span>\n\n<span class="token attribute attr-name">#[macro_use]</span> <span class="token keyword">extern</span> <span class="token keyword">crate</span> rocket<span class="token punctuation">;</span>\n\n<span class="token attribute attr-name">#[get(<span class="token string">"/"</span>)]</span>\n<span class="token keyword">fn</span> <span class="token function-definition function">index</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">-></span> <span class="token operator">&amp;</span><span class="token lifetime-annotation symbol">\'static</span> str <span class="token punctuation">{</span>\n    <span class="token string">"Hello, world!"</span>\n<span class="token punctuation">}</span>\n\n<span class="token keyword">fn</span> <span class="token function-definition function">main</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    rocket<span class="token punctuation">::</span><span class="token function">ignite</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">mount</span><span class="token punctuation">(</span><span class="token string">"/"</span><span class="token punctuation">,</span> <span class="token macro property">routes!</span><span class="token punctuation">[</span>index<span class="token punctuation">]</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">launch</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n<p>我们现在不会确切解释该程序的功能。我们将其留给指南的其余部分。简而言之，它将创建一条<code>index</code>路由，将该路由 <em>绑定</em> 在 <code>/</code> 路径上，然后启动应用程序。使用<code>cargo run</code>编译并运行程序。您应该看到以下内容：</p>\n<pre class="language-shell"><code class="language-shell">🔧  Configured <span class="token keyword">for</span> development.\n    <span class="token operator">=</span><span class="token operator">></span> address: localhost\n    <span class="token operator">=</span><span class="token operator">></span> port: <span class="token number">8000</span>\n    <span class="token operator">=</span><span class="token operator">></span> log: normal\n    <span class="token operator">=</span><span class="token operator">></span> workers: <span class="token punctuation">[</span>logical cores * <span class="token number">2</span><span class="token punctuation">]</span>\n    <span class="token operator">=</span><span class="token operator">></span> secret key: generated\n    <span class="token operator">=</span><span class="token operator">></span> limits: forms <span class="token operator">=</span> 32KiB\n    <span class="token operator">=</span><span class="token operator">></span> keep-alive: 5s\n    <span class="token operator">=</span><span class="token operator">></span> tls: disabled\n🛰  Mounting <span class="token string">\'/\'</span><span class="token builtin class-name">:</span>\n    <span class="token operator">=</span><span class="token operator">></span> GET / <span class="token punctuation">(</span>index<span class="token punctuation">)</span>\n🚀  Rocket has launched from <a class="token url-link" href="http://localhost:8000">http://localhost:8000</a>\n</code></pre>\n<p>访问<code>http://localhost:8000</code>以查看您的第一个Rocket应用程序在运行！</p>\n<h3 id="提示不喜欢颜色或表情符号">提示：不喜欢颜色或表情符号？<a class="anchor" href="Getting-Started/Hello-World.html#提示不喜欢颜色或表情符号">§</a></h3>\n<p>您可以通过将<code>ROCKET_CLI_COLORS</code>环境变量设置为<code>0</code>或<code>off</code>在运行Rocket二进制文件时禁用颜色和表情符号：</p>\n<pre class="language-shell"><code class="language-shell"><span class="token assign-left variable">ROCKET_CLI_COLORS</span><span class="token operator">=</span>off cargo run\n</code></pre>'
